/**
 * @description 针对 equipmentManagement 路由的 URL 规范化
 * 如果命中 /#/equipmentManagement，则强制改写前缀为
 * https://service.emposat.com/main-app/child/station-control#/
 */
const normalizeEquipmentUrl = (rawUrl) => {
    try {
        const u = new URL(rawUrl, window.location.href)
        const hash = u.hash || ''
        if (hash.startsWith('#/equipmentManagement')) {
            return 'https://service.emposat.com/child/station-control/index.html' + hash
        }
        return u.toString()
    } catch (e) {
        // URL 解析失败，返回原始字符串
        return rawUrl
    }
}

const hookClick = (e) => {
    const origin = e.target.closest('a')
    const isBaseTargetBlank = document.querySelector(
        'head base[target="_blank"]'
    )
    console.log('origin', origin, isBaseTargetBlank)
    if (
        (origin && origin.href && origin.target === '_blank') ||
        (origin && origin.href && isBaseTargetBlank)
    ) {
        e.preventDefault()
        console.log('handle origin', origin)
        location.href = origin.href
    } else {
        console.log('not handle origin', origin)
    }
}

window.open = function (url, target, features) {
    console.log('open', url, target, features)
    const normalized = normalizeEquipmentUrl(url)
    location.href = normalized
}

document.addEventListener('click', hookClick, { capture: true })
